import { SOCKET_CLUE_MESSAGE, SOCKET_GUESS_MESSAGE } from '../action_types/actionTypes.js';

const noAction = {
  type: 'NO_ACTION',
};

export default (state = [], action = noAction) => {
  switch (action.type) {
    case SOCKET_GUESS_MESSAGE:
      return state.concat([{
        type: 1,
        userid: action.userid,
        message: action.message,
      }]);
    case SOCKET_CLUE_MESSAGE:
      return state.concat([{
        type: 2,
        userid: action.userid,
        message: action.message,
      }]);
    default:
      return state;
  }
};

import { SOCKET_PLAYER_JOIN_GAME } from '../action_types/actionTypes.js';

const noAction = {
  type: 'NO_ACTION',
};

const mergeNewUser = (state, user) => {
  const newUser = {};
  newUser[user.id] = user;
  return Object.assign({}, state, newUser);
};

export default (state = {}, action = noAction) => {
  switch (action.type) {
    case SOCKET_PLAYER_JOIN_GAME:
      return mergeNewUser(state, action.user);
    default:
      return state;
  }
};

export default function reducer(state = { scene: {} }, action = {}) {
  switch (action.type) {
    case 'focus':
      return { 
        ...state,
        scene: action.scene,
      };
    default:
      return state;
  }
}

